import React from "react";
import SideBarDD from "../SideBarD";
import AddData from "./AddData";
import WelcomeBarD from "../WelcomeBar";

import {
  SideBarContainer,
  ContentContainer,
  DashboardContainer,
} from "./DataElements";

const DashAccount = () => {
  return (
    <>
      <DashboardContainer>
        <SideBarContainer>
          <SideBarDD></SideBarDD>
        </SideBarContainer>
        <ContentContainer>
          <WelcomeBarD path={tellPath()}></WelcomeBarD>
          <AddData></AddData>
        </ContentContainer>
      </DashboardContainer>
    </>
  );
};

export default DashAccount;
